import React from "react";

import texture from "../../assets/bg-texture.png";
import extreme from "../../assets/extreme.png";
import lang from '../../assets/lang.svg'

import s from "./Main.module.css";

const Main = () => {
  return (
    <div className={s.container}>
      <div className={s.left}>
        <img src={extreme} alt="extreme" className={s.extreme} />
        <a className={s.link}>Главная</a>
        <a className={s.link}>Проверка</a>
        <a className={s.link}>Репрессии</a>
        <a className={s.link}>Петиция</a>
        <div className={s.stat}>
          <div className={s.statBlock}>
            <p className={s.number}>28</p>в тюрьмах
          </div>
          <div className={s.statBlock}>
            <p className={s.number}>274</p>уволено и<br /> отчислено
          </div>
          <div className={s.statBlock}>
            <p className={s.number}>459</p>подписали
            <br /> петицию
          </div>
        </div>
        <button className={s.lang}>ru <img src={lang} alt="" /></button>
      </div>
      <div className={s.inner}></div>
      <img src={texture} alt="texture" />
    </div>
  );
};

export default Main;
